import { fn } from '@storybook/test';
import { ButtonComponent } from './button.component';
const meta = {
    title: 'Example/Button',
    component: ButtonComponent,
    tags: ['autodocs'],
    argTypes: {},
    args: { onClick: fn() },
};
export default meta;
export const Primary = {
    args: {
        block: true,
        color: 'primary',
        isDisabled: false,
        label: 'Primary',
        loading: false,
    },
};
export const Secondary = {
    args: {
        ...Primary.args,
        color: 'secondary',
        label: 'Secondary',
    },
};
